*{
    margin: 0;
    padding: 0;
    box-sizing: border-box;
}
ul { list-style-type:none;}
body {
    background-color: #ddd;
}

/* page css */
.box {
    display: flex;
    flex-direction: column;
}


header {
    padding: 10px;
}
header svg {
    margin-right: 25px;
}
header svg:hover {
    cursor: pointer;
    filter: invert(78%) sepia(52%) saturate(4753%) hue-rotate(359deg) brightness(102%) contrast(105%);
}


.aside ul{
    display: inline-block;
    margin-top: 20px;
    margin-left: 8px;
}
.aside li{
    width: 38px;
    height: 38px;
    border-radius: 50%;
    margin-top: 10px;
    border: 1px solid #ccc;
}
.aside li:hover{
    cursor: pointer;
}
